import React from "react";
import "./tweet.css";
import Tweet from "./tweet.json"
function Twitter() {
    return (
        <div>
            <h3 className="h3">Twitter scams.....</h3>
            <br />
            <br />
            {
                Tweet.map(tweet => {
                    return (
                        <div className="box" key={tweet.id}><br />
                            <strong>URL:</strong>{tweet.url}<br />
                            <strong></strong>Tweet_link:{tweet.tweet_link}<br />
                            <strong></strong>User_id:{tweet.user_id}<br />
                            <strong></strong>Hastag:{tweet.hastag}<br />
                            Retweet_count:{tweet.retweet_count}<br />
                            Share_count:{tweet.share_count}<br />
                            Description:{tweet.description}<br />
                            Following:{tweet.following}<br />
                            Followers:{tweet.followers}

                        </div>

                    )
                })
            }
        </div>
    );
}

export default Twitter;
